t(lfe,[["__scopeId","data-v-70173bd8"]]),cfe={},dfe={class:"page"},hfe=_k('<h2 data-v-484d9cb8>使い方関連</h2><h3 data-v-484d9cb8>基本的な使い方を教えて</h3><p data-v-484d9cb8> まずスプレッドシート等で所持ポケモンを管理していた方は、ボックス右下のTSVインポート機能でポケモン一覧をインポートしてください。<br data-v-484d9cb8> そうでない方は、ボックス左下の新規登録から登録してください。PCならローマ字のままキーボードで打ち込んでいくだけで入力が可能です。<br data-v-484d9cb8> 登録すると、そのポケモンがどの程度厳選されているか、どの5匹でチームを組むと最もエナジーが稼げるかがシミュレーションできます（日替わりでメンバーを入れ替える運用のシミュレーションはまだ未対応です）<br data-v-484d9cb8><br data-v-484d9cb8> 解説動画を撮ったので、もし動画の方が聞きやすい方はこちらでどうぞ。<br data-v-484d9cb8><a href="https://www.youtube.com/live/wj_QK7zlsG0" target="_blank" data-v-484d9cb8>https://www.youtube.com/live/wj_QK7zlsG0</a></p><h3 data-v-484d9cb8>ポケモン一覧で2条件以上でソートしたい</h3><p data-v-484d9cb8> シフト押しながらクリックすると2条件でソートできます。 </p><h3 data-v-484d9cb8>不具合見つけたんだけど</h3><p data-v-484d9cb8><a href="https://x.com/harezora_lueur" target="_blank" data-v-484d9cb8>@harezora_lueur</a>とか<a href="https://github.com/reimer0204/pokesle-simulator" target="_blank" data-v-484d9cb8>GitHub</a>とかに連絡ください。 </p><h2 data-v-484d9cb8>仕様関連</h2><h3 data-v-484d9cb8>入れ替えとか削除でいちいち再計算入るのどうにかならない？</h3><p data-v-484d9cb8> どうにかしたいとは思っています。 </p><h3 data-v-484d9cb8>厳選評価の仕組みは？</h3><p data-v-484d9cb8> 最終進化のポケモンについて全サブスキル・全せいかくの組み合わせにおける1日のエナジー期待値を計算し、その順位を基準に評価しています。<br data-v-484d9cb8> まずは下記の通常スキルを持ったポケモンを計算し、それぞれの厳選度上位(デフォルト90%)の期待値エナジーを集計し、その上位50%を元にサポート系スキルを持ったポケモンの評価をします。 <br data-v-484d9cb8> きのみ：カビゴンの好きなきのみ前提<br data-v-484d9cb8> 食材：設定により基礎エナジ～最良の料理×最大レシピレベル<br data-v-484d9cb8> 通常スキル<br data-v-484d9cb8> ・エナジーチャージ：そのまま<br data-v-484d9cb8> ・食材ゲット：上記食材と同等の評価<br data-v-484d9cb8> ・料理パワーアップ：(最良の料理 - 通常のなべで作れる最良の料理) / 鍋サイズの差分 ×効果量<br data-v-484d9cb8> ・料理チャンス：1週間編成し続け、最良の料理×最大レシピレベルを作り続けた際の増分を7日で割った値<br data-v-484d9cb8> サポート系スキル<br data-v-484d9cb8> ・おてつだいサポート/おてつだいブースト：上位50％の平均お手伝いエナジー×効果量<br data-v-484d9cb8> ・げんきエール/げんきオール：(げんき回復あり - げんき回復なし)×上位50％の平均日給エナジー<br data-v-484d9cb8> ・ゆめのかけらゲット：効果量×設定のゆめのかけらゲット評価値<br data-v-484d9cb8><br data-v-484d9cb8> ※ゆめのかけらゲットはサポート系スキルではありませんが、エナジー換算する時にぶっ飛んだ数字になってサポート対象に含むと値が変になるので後回し組に含めています。 </p><h3 data-v-484d9cb8>げんき回復量0でも日中の効率175%くらいでおてつだいしてるっぽいんだけど？</h3><p data-v-484d9cb8> 8.5時間睡眠している場合、200分間はお手伝い時間45%、次の200分間は…と素直に計算すると168%くらいになるんですが、例えば最初の199分時点でおてつだいが発生して次のお手伝い時間が決まった場合は実質200分より長く最高効率で動けることになるので、その分168%より少し長くなってます。<br data-v-484d9cb8> おてつだいキューの詳細が分からないのでこの挙動が正しいかは不明です。もしかしたらまたぐ時は両方の値を参照するのが本当は正しいかもしれません。 </p><h3 data-v-484d9cb8>ラルトスの進化先に問答無用でエルレイドが表示されるんだけど</h3><p data-v-484d9cb8> それだけのために性別の入力欄作るの面倒だったので許してください。 </p><h3 data-v-484d9cb8>今後予定している機能は？</h3><p data-v-484d9cb8> ・日曜に食材等の準備をするパターンのシミュレーション<br data-v-484d9cb8> ・料理ごとのレシピレベル設定(今は一律最大値固定)<br data-v-484d9cb8> ・指定レベル/最終進化になった仮定でシミュレーションして誰を育成すべきか判断できるやつ<br data-v-484d9cb8> ・任意のポケモンをチーム編成に固定する機能 </p><h2 data-v-484d9cb8>技術関連</h2><h3 data-v-484d9cb8>もっと処理速くならない？</h3><p data-v-484d9cb8><a href="https://github.com/reimer0204/pokesle-simulator" target="_blank" data-v-484d9cb8>GitHub</a>でソースコード公開してるので助けてください。プルリク歓迎です。 </p><h3 data-v-484d9cb8>なんでIndexedDB使わないでLocalStorage使ってるの？</h3><p data-v-484d9cb8> 容量的になんとか足りたので…どっちがいいんだろうね？ </p><h3 data-v-484d9cb8>要望出したいんだけど</h3><p data-v-484d9cb8><a href="https://x.com/harezora_lueur" target="_blank" data-v-484d9cb8>@harezora_lueur</a>とか<a href="https://github.com/reimer0204/pokesle-simulator" target="_blank" data-v-484d9cb8>GitHub</a>とかに連絡ください。自分も欲しい機能なら作ります。 </p>',25),pfe=[hfe];function ffe(n,e){return _(),T("div",dfe,pfe)}const mfe=Nt(cfe,[["render",ffe],["__scopeId","data-v-484d9cb8"]]),gfe={},bfe={class:"page"},xfe=_k("<h2 data-v-d7b8031b>更新履歴</h2><h3 data-v-d7b8031b>2024/08/24</h3><ul data-v-d7b8031b><li data-v-d7b8031b>厳選の指標にとくい分野のみのものを追加</li></ul><h3 data-v-d7b8031b>2024/08/19</h3><ul data-v-d7b8031b><li data-v-d7b8031b>ウパー、ヌオーのデータを追加</li><li data-v-d7b8031b> ヒーラーの計算をより正確なものに修正 <ul data-v-d7b8031b><li data-v-d7b8031b>スキルストックが2の場合の計算がより正確になり、ヒーラー導入時の計算誤差が平均2%ほどになりました。</li></ul></li><li data-v-d7b8031b> 仮定設定を追加 <ul data-v-d7b8031b><li data-v-d7b8031b>サブスキルのたね、メインスキルのたねをあげた場合を追加</li><li data-v-d7b8031b>厳選度が高い個体のみ仮定で計算する設定を追加</li><li data-v-d7b8031b>仮定チェックボックスでまとめてON/OFFできるよう改善</li></ul></li></ul><h3 data-v-d7b8031b>2024/08/11</h3><ul data-v-d7b8031b><li data-v-d7b8031b>厳選テーブルのバージョンが古い場合、厳選情報を表示しないよう改善</li><li data-v-d7b8031b>ポケモン情報編集時に、ボックスの厳選の状況を追加</li><li data-v-d7b8031b>一部列でソートしようとするとエラーが出る不具合を修正</li></ul><h3 data-v-d7b8031b>2024/07/31</h3><ul data-v-d7b8031b><li data-v-d7b8031b>ボックスでの概算スコア計算時、ヒーラーの期待計算に不備があったため修正</li><li data-v-d7b8031b>睡眠時間がスプレッドシート連携の対象から外れている問題を修正</li></ul><h3 data-v-d7b8031b>2024/07/30</h3><ul data-v-d7b8031b><li data-v-d7b8031b> シミュレーションの設定で料理を選択可能に変更 <ul data-v-d7b8031b><li data-v-d7b8031b>カンストしている料理を避けつつ極力エナジーを稼ぐ計算などに使えます</li></ul></li><li data-v-d7b8031b> ヒーラーの計算にスキルストックを反映 <ul data-v-d7b8031b><li data-v-d7b8031b>深層学習がうまくできておらず、スキルストックがなかった時より高いですが本来より若干低めに出てそうです。</li></ul></li><li data-v-d7b8031b>厳選テーブル作成の設定におやすみリボンの時間を追加</li><li data-v-d7b8031b>所持ポケモンの設定におやすみリボンの時間を追加</li><li data-v-d7b8031b>日別シミュレーションに料理の回数設定を追加</li><li data-v-d7b8031b>各種チームシミュレーションで伝説ポケモンを2匹以上組み込む編成が出ないよう改善</li></ul><h3 data-v-d7b8031b>2024/07/21</h3><ul data-v-d7b8031b><li data-v-d7b8031b> げんき計算を重回帰分析から深層学習に変更 <ul data-v-d7b8031b><li data-v-d7b8031b>ちょっと重くなっちゃったかもしれないけど精度がかなり上がりました(誤差が従来に比べて90%減)</li><li data-v-d7b8031b>睡眠時間が短い場合の計算もより正確になりました</li><li data-v-d7b8031b>睡眠時間/チェック頻度による各々の計算が不要になったので、厳選テーブルの再計算は設定タブで行うことにしました</li></ul></li><li data-v-d7b8031b>厳選テーブルタブをやめてデータタブにし、食材・料理・ポケモンの情報を掲載</li><li data-v-d7b8031b>厳選テーブル生成時、食材ゲットSが高く評価されすぎないよう設定値を追加</li></ul><h3 data-v-d7b8031b>2024/07/16</h3><ul data-v-d7b8031b><li data-v-d7b8031b>新規ポケモン9匹の情報を追加</li><li data-v-d7b8031b>ローマ字入力の対応に漏れがあったので追加</li></ul><h3 data-v-d7b8031b>2024/07/13</h3><ul data-v-d7b8031b><li data-v-d7b8031b>イベントボーナスの適用がタイプ指定しかできなかったので「全員」を追加</li></ul><h3 data-v-d7b8031b>2024/07/11</h3><ul data-v-d7b8031b><li data-v-d7b8031b>料理のレシピを最新のものに更新(これに伴い食材の価値が変わったため要再計算)</li></ul><h3 data-v-d7b8031b>2024/07/09</h3><ul data-v-d7b8031b><li data-v-d7b8031b>げんきの計算を最新版のものに修正</li><li data-v-d7b8031b>指定レベル・最終進化を仮定してシミュレーションできる設定をボックスに追加</li></ul><h3 data-v-d7b8031b>2024/07/06</h3><ul data-v-d7b8031b><li data-v-d7b8031b>週末準備用のシミュレーション機能を追加(まだベータ版です)</li></ul><h3 data-v-d7b8031b>2024/07/05</h3><ul data-v-d7b8031b><li data-v-d7b8031b>チームシミュレーションの際、おてつだいサポート、おてつだいブーストで得られるきのみの評価にきのみ率ではなく食材率が使用されていた不具合を修正</li><li data-v-d7b8031b>週間シミュレーションのスコアの表示を改善</li></ul><h3 data-v-d7b8031b>2024/06/26</h3><ul data-v-d7b8031b><li data-v-d7b8031b>ボックス画面でチームシミュレーションの対象とするか、必須でいれるかの設定を追加</li></ul><h3 data-v-d7b8031b>2024/06/25</h3><ul data-v-d7b8031b><li data-v-d7b8031b>一部ポケモンのバランス調整を反映していなかったので修正</li><li data-v-d7b8031b>データ更新があった場合、更新を促す表示を追加</li><li data-v-d7b8031b> 入力データの食材に不備があった場合にポケモン一覧がローディング状態となり修正もできなくなる問題を修正 <ul data-v-d7b8031b><li data-v-d7b8031b>他のところではまだエラー出るかも</li></ul></li><li data-v-d7b8031b>入力データの食材に不備がある場合、ポケモン一覧で強調表示される機能を追加</li></ul><h3 data-v-d7b8031b>2024/06/23</h3><ul data-v-d7b8031b><li data-v-d7b8031b>とりあえず公開</li></ul>",31),yfe=[xfe];function kfe(n,e){return _(),T("div",bfe,yfe)}const vfe=Nt(gfe,[["render",kfe],["__scopeId","data-v-d7b8031b"]]),Dp=vT(MQ);Dp.use(BQ,{expires:"30y"});Dp.use(HQ);Dp.use(IE({history:tE(),routes:[{path:"/",component:qhe},{path:"/data",component:gpe},{path:"/setting",component:ufe},{path:"/faq",component:mfe},{path:"/history",component:vfe}]}));document.addEventListener("visibilitychange",()=>{document.visibilityState==="visible"&&Rt.importGoogleSpreadsheet(!0)});Dp.mount("#app");
